import Card from "./card/card.view";

const HomeView = ({ users, animalsList }) => {
  const [ age, name, isActive ]  = { ...users };
  const [ given, surname ] = { ...name };

  return (
    <div>
      <div>
        <Card name={given} surname={surname} age={age} isActive={isActive} animals={animals} animalsList={animalsList} />
      </div>
    </div>
  )
}

export default HomeView;
